import React, { Component } from 'react';
var json = require ('./src/Components/mydata.json');

class About extends Component {
  render() {
    if(json.props.data){
      console.log(this.props.data);
      var name = this.props.data.name;
      var image = 'images/profile-pic.png'; //+this.props.data.image
      var bio = this.props.data.bio;
      var street = this.props.data.adress.street;
      var city = this.props.data.adress.city;
      var country = this.props.data.adress.country;
      var zip = this.props.data.adress.zip;
      var phone = this.props.data.phone;
      var email = this.props.data.email;
      var resumedownload = this.props.data.resumedownload;
    }
    return (
      <section id="about">
        <div className="row">
          <div className="three columns">
          <img className="profile-pic"  src="images/profilepic.jpg" alt="" />
          </div>
          <div className="nine columns main-col">
            <h2>Обо мне</h2>
            <p>{bio}</p>
            <div className="row">
              <div className="columns contact-details">
                <h2>Подробнее</h2>
                <p className="address">
     						  <span>{name}</span><br />
     						  <span>{street}<br />
     						  {city} {country}, {zip}
                  </span><br />
     						  <span>{phone}</span><br />
                  <span>{email}</span>
   					    </p>
              </div>
              <div className="columns download">
                <p><a href="https://docs.google.com/document/d/1CJyw9181w6Gkx0TJ4_zL4j-f0zvgRU0abobxNSbm6FQ/edit?usp=sharing" className="button"><i className="fa fa-download"></i>Download Resume</a></p>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default About;
